import React from "react";

import Header from "./Sub-components/Header";
import Footer from "./Sub-components/Footer";
import Notes from "./Sub-components/Notes";



function App(){
    return (
        <div>
            <Header></Header>
            <Notes></Notes>
            <Footer></Footer>
        </div>
    )
}

export default App;
